// /en/i18n_catalog/ :: get_catalog() modifies it
i18n_catalog = {};


gettext = function (msgid) {
    var value = i18n_catalog[msgid];
    if (typeof(value) == 'undefined') {
        return msgid;
    } else {
        return (typeof(value) == 'string') ? value : value[0];
    }
};

ngettext_0 = function(singular, plural, count) {
    var value = i18n_catalog[singular];
    if (typeof(value) == 'undefined') {
        return (count == 1) ? singular : plural;
    } else {
        if (typeof(value) == 'string') {
            return value;
        } else {
            reduced_count = (count <= 1) ? 0 : 1;
            return value[reduced_count];
        }
    }
};

ngettext = function(singular, plural, count) {
    var rc = ngettext_0(singular, plural, count);
    return sprintf(rc, {num: count});
};

